pragma solidity >=0.5.0;

import "./IERC20.sol";

interface IController {
    function stakeTokens(address token, uint256 amount) external returns (bool);

    function withdrawToken(address token, uint256 amount) external returns (bool);

    function harvestTokens(address token) external returns (bool);

    function getStaking(address token) external view returns (address);

    function getEarnedAmount(address token) external view returns (uint256);
}

